// Import necessary libraries and components
import React, { Component } from 'react';
import { Card, CardBody, CardTitle, CardText, Button } from 'reactstrap';
import './identity.css'

// Define the Identify component class
class Identify extends Component {
 render() {
    return (
      <Card className="card">
        <CardBody>
          <CardTitle tag="h5">Identify</CardTitle>
          <CardText>Identify features within the provided image.</CardText>
          <Button color="light">Select Image</Button>
        </CardBody>
      </Card>
    );
 }
}

// Export the Identify component
export default Identify;
